  return (
    <div className='dinnerItem'>
        <div style={{ backgroundImage: `url(${image})`}}></div>
      <h1> {name} </h1>
      <ul className='duration'>
        <li>
          {prepTime}
        </li>
        <li>
          {cookTime}
        </li>
        <li className='time'>
          {time}
        </li>
        <li className='heat'>
          {heat}
        </li>
        <li className='servings'>
          {servings}
        </li>
      </ul>
      <ul>
        <li>
          {ingredients1}
        </li>
        <li>
          {ingredients2}
        </li>
        <li>
          {ingredients3}
        </li>
        <li>
          {ingredients4}
        </li>
