          {ingredients5}
        </li>
        <li>
          {ingredients6}
        </li>
        <li>
          {ingredients7}
        </li>
        <li>
          {ingredients8}
        </li>
        <li>
          {ingredients9}
        </li>
        <li>
          {ingredients10}
        </li>
        <li>
          {ingredients11}
        </li>
        <li>
          {ingredients12}
        </li>
        <li>
          {ingredients13}
        </li>
        <li>
          {ingredients14}
        </li>
        <li>
          {ingredients15}
        </li>
        <li>
          {ingredients16}
        </li>
        <li>
          {ingredients17}
        </li>
      </ul>
      <ol>
        <li>
          {instructions1}
        </li>
        <li>
          {instructions2}
        </li>
        <li>
          {instructions3}
        </li>
        <li>
          {instructions4}
        </li>
        <li>
          {instructions5}
        </li>
      </ol>
      <p className='who'> {byWho} </p>
    </div>
  )
}

export default DinnerItem
